import React, { useState } from 'react'

const PropsFromChildToParent = () => {


  const [text,setText] = useState('');  

  const onHandler = (event) => {
    setText(event.target.value);
  }

  return (
    <div>
        <form>
            <div class="form-group">
                <label for="formGroupExampleInput">Text </label>
                <input type="text" class="form-control" id="formGroupExampleInput" placeholder="Text" value={text} onChange={onHandler}/>
            </div>
        </form>
    </div>
  )
}

export default PropsFromChildToParent
